  "description": "<p>Acana Puppy Large Breed dog food is a grain-free diet specially made for puppies weighing more than 25kgs at maturity.</p>\n<p>ACANA's Biologically Appropriate* diets are specially put together to suit their evolutionary digestive needs. All their ingredients are responsibly and regionally sourced, free-run poultry, wild-caught fish and nest-laid eggs. ACANA's food is carefully prepared in their own award-winning kitchens to control quality. They use WholePrey Ratios in order to provide your growing puppy with vitamins and minerals naturally, rather than adding them as supplements.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Food Type: Dry puppy food</li>\n<li>For puppies weighing more than 25 kgs at maturity</li>\n<li>70% Protein content, 30% botanicals</li>\n<li>Grain-free - 0% grains, potato, tapioca</li>\n<li>2/3<sup>rd</sup> of the meat is dehydrated <i>without preservatives</i>\n</li>\n<li>1/3<sup>rd</sup> of the meat is fresh <i>without preservatives</i>\n</li>\n<li>WholePrey Ratios rich in nutrients</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles</li>\n<li>Made in Canada</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never exceed recommended feeding quantities unless prescribed by a vet</li>\n</ul>\n<p><strong><span>Ingredients: </span></strong><span>Fresh chicken meat (16%), chicken meal (15%), turkey meal (14%), red lentils, whole green peas, fresh chicken giblets (liver, heart, kidney) (6%), herring meal (4%), fresh whole eggs (4%), fresh whole flounder (4%), herring oil (3%), sun-cured alfalfa (2%), field beans (2%), green lentils, whole yellow peas, pea fibre, chicken fat (2%), fresh chicken cartilage (2%), dried brown kelp, fresh whole pumpkin, fresh whole butternut squash, fresh whole parsnips, fresh kale, fresh spinach, fresh mustard greens, fresh turnip greens, fresh whole carrots, fresh red delicious apples, fresh Bartlett pears, freeze-dried chicken liver, freeze-dried turkey liver, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric, milk thistle, burdock root, lavender, marshmallow root, rose hips<strong>. </strong></span>Supplements <strong></strong><span>Zinc chelate. Vitamin E (preservative)</span></p>\n<p><strong>HUFT Tip:</strong> Large breed puppies have a longer growth period and require a diet that is rich in vitamins and minerals to develop strong bones to hold the weight of their adult bodies. The right diet with supplements is very important in the growing years.</p>\n<p><strong>Feeding Guideline: </strong>Feeding requirements will vary based on his level of activity, environment and age.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/9_large.JPG?v=1556284260\" alt=\"\"></p>\n<p><strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">Please Note: </span></strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet</span></p>",
