  "description": "<p>This dry food diet is loaded with fresh fish from the Pacific waters. It also contains low-glycemic carbohydrates from steel-cut oats which help to keep blood sugar stable and optimize physical conditioning.</p>\n<p>ACANA's award-winning NorthStar kitchens prepare Biologically Appropriate* recipes and WholePrey ratios to ensure a nutrient-dense diet that is developed to mirror the diet that nature intended for your pet. The only added supplements are Vitamin E, Choline chloride, Zinc chelate, Vitamin B5, Copper chelate.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>For all breeds and life stages</li>\n<li>50% fish and 50% vegetables, fruits and botanicals</li>\n<li>High-quality ingredients fit for human consumption</li>\n<li>Whole Prey Ratios rich in nutrients</li>\n<li>2/3<sup>rd</sup>of the meat is dehydrated <em>without preservatives</em>\n</li>\n<li>1/3<sup>rd</sup>of the meat is fresh <em>without preservatives</em>\n</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles</li>\n</ul>\n<p><strong>Ingredients: </strong>Herring meal (24%), steel-cut oats (23%), fresh whole Pacific herring (10%), fresh whole flounder (6%), herring oil (6%), cold-pressed canola oil, fresh whole silver hake (4%), whole red lentils, whole green peas, whole green lentils, whole garbanzo beans, whole yellow peas, oats, sun-cured alfalfa, lentil fibre, dried brown kelp, fresh pumpkin, fresh butternut squash, fresh parsnips, fresh green kale, fresh spinach, fresh carrots, fresh Red Delicious apples, fresh Bartlett pears, freeze-dried herring (0.1%), fresh cranberries, fresh blueberries, chicory root, turmeric root, milk thistle, burdock root, lavender, marshmallow root, rosehips.</p>\n<p><strong>Precautions:</strong></p>\n<ul>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never exceed recommended feeding quantities unless prescribed by a vet</li>\n</ul>\n<p>Contains mixed tocopherols (a tocopherol-rich extract of natural origin- Vitamin E and Rosemary Oil). Also contains the probiotic Enterococcus faecium.</p>\n<p><strong>HUFT Tip: </strong>Remember to <strong></strong>wash your pet's bowls often. They easily pick up bacteria and other harmful microbes so it is important to wash them out regularly to keep your pet from falling sick.</p>\n<p><strong>Feeding Guideline: </strong>Feeding requirements will vary based on your pet's level of activity, environment and age.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/12_large.JPG?v=1556284591\" alt=\"Acana Wild Coast Fish Formula Dry Dog Food (All Breeds &amp; Ages)\" style=\"font-size: 1.4em;\"><br></p>\n<p><strong><em>Please Note: </em></strong><em>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet.</em></p>\n<p><strong>Supplements: </strong>Vitamin E, Choline chloride, Zinc chelate, Vitamin B5, Copper chelate.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/12.1_large.JPG?v=1556284604\" alt=\"Acana Wild Coast Fish Formula Dry Dog Food (All Breeds &amp; Ages)\" width=\"250\" height=\"266\"></p>",
