  "id": 2026564550718,
  "title": "Acana Large Breed Adult Dry Dog Food",
  "handle": "acana-adult-large-breed-dog-food-available-in-multiple-sizes",
  "description": "<p>Acana Adult Large Breed dog food is a specially formulated grain-free diet for adult dogs over 25 kgs. This formula is specially designed to maintain your pet's weight and helps take the stress off his or her bones and joints.</p>\n<p>ACANA uses a Biologically Appropriate* approach for all their recipes. So each recipe is put together to suit the evolutionary needs of your pet. ACANA's recipes are made in their own award-winning kitchens so they are able to control the quality of their food. Sustainably sourced free-range poultry, wild-caught fish and nest-laid eggs add to the quality of their food.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>For large breed adults (over 25 kg)<br>\n</li>\n<li>60-75% meat protein</li>\n<li>Grain-free - 0% grains, potato, tapioca</li>\n<li>High-quality ingredients fit for human consumption</li>\n<li>2/3<sup>rd</sup> of the meat is dehydrated <i>without preservatives</i>\n</li>\n<li>1/3<sup>rd</sup> of the meat is fresh <i>without preservatives</i>\n</li>\n<li>WholePrey ratios rich in nutrients</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food</li>\n<li>Nutrient Profiles</li>\n<li>Made in Canada</li>\n</ul>\n<p><strong>Pet parents please note:</strong></p>\n<ul>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<p><strong>Ingredients: </strong><span>Fresh chicken meat (13%), chicken meal (12%), turkey meal (11%), red lentils, whole green peas (8%), field beans, fresh chicken giblets (liver, heart, kidney) (4%), herring meal (4%), fresh whole eggs (4%), fresh whole flounder (4%), herring oil (3%), chicken fat (3%), sun-cured alfalfa, green lentils, whole yellow peas, pea fibre, fresh chicken cartilage (2%), dried brown kelp, fresh whole pumpkin, fresh whole butternut squash, fresh whole parsnips, fresh kale, fresh spinach, fresh mustard greens, fresh turnip greens, fresh whole carrots, fresh red delicious apples, fresh Bartlett pears, freeze-dried chicken liver, freeze-dried turkey liver, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric, milk thistle, burdock root, lavender, marshmallow root, rose hips.</span></p>\n<p><strong>HUFT Tip:</strong> Large breed dogs are prone to having issues with their joints and bones. You need to keep a close eye on their weight to prevent further strain on them. One of the easiest ways of keeping your pet's weight in check is to regulate their food quantities. Check with your vet to make sure you are not overfeeding your pet.</p>\n<p><strong>Feeding Guide: </strong>Feeding requirements will vary based on your pet's level of activity, environment and age.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/7guide.JPG?v=1556265816\" alt=\"\" width=\"492\" height=\"153\"></p>\n<p><strong>Please Note: </strong>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet</p>\n<p><strong>Guaranteed Analysis: </strong>Crude protein (min.) 31%, Fat content (min.) 15%, Crude ash (max.) 7%, Crude fibres (max.) 6%, Moisture(max.) 12%, Calcium (min.) 1.4%, Phosphorus (min.) 1.1%, Omega-6 fatty acids (min.) 2.4%, Omega-3 fatty acids (min.) 1.2%, DHA(min.) 0.4%, EPA(min.) 0.4%, Glucosamine (min.) 1500 mg/kg, Chondroitin sulfate (min.) 900 mg/kg, Linoleic acid (min.) 2.2%, Carbohydrate (NFE) 29%</p>\n<p><strong>Botanical Inclusions:</strong></p>\n<p><strong><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1bot_large.JPG?v=1556265921\" alt=\"\" width=\"274\" height=\"169\"></strong></p>",
