  "description": "<p>Acana Puppy &amp; Junior food is a grain-free diet specially made for puppies who weigh between 9-25 kg at maturity. This dry food formula is loaded with 70% meat and 30% fruits and vegetables.</p>\n<p>The proteins come from regionally sourced, and fresh, free-run poultry, wild-caught fish and nest-laid eggs. Made in ACANA's award-winning kitchens, the meal is free from preservatives. WholePrey Ratios ensure that most nutrients are supplied naturally.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>For puppies weighing 9-25 kgs at maturity<br>\n</li>\n<li>70% Protein content, 30% botanicals</li>\n<li>Grain-free - 0% grains, potato, tapioca</li>\n<li>2/3<sup>rd</sup>of the meat is dehydrated without preservatives</li>\n<li>1/3<sup>rd</sup>of the meat is fresh without preservatives</li>\n<li>Nutrient-dense WholePrey Ratios</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles</li>\n<li>Made in Canada</li>\n</ul>\n<p><strong>Ingredients: </strong>Fresh chicken meat (16%), chicken meal (13%), turkey meal (13%), red lentils, whole green peas, fresh chicken giblets (liver, heart, kidney) (6%), chicken fat (6%), fresh whole eggs (4%), fresh whole flounder (4%), herring meal (3%), herring oil (3%), sun-cured alfalfa (2%), green lentils, field beans (2%), whole yellow peas, pea fibre, fresh chicken cartilage (2%), dried brown kelp, fresh whole pumpkin, fresh whole butternut squash, fresh whole parsnips, fresh kale, fresh spinach, fresh mustard greens, fresh turnip greens, fresh whole carrots, fresh red delicious apples, fresh Bartlett pears, freeze-dried chicken liver, freeze-dried turkey liver, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric, milk thistle, burdock root, lavender, marshmallow root, rose hips. Supplements Zinc chelate. Vitamin E (preservative).</p>\n<p><strong>Precautions:</strong></p>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never exceed recommended feeding quantities unless prescribed by a vet</li>\n<p> </p>\n<p><strong>HUFT Tip: </strong>The growing years are the most important for your puppy and will determine the agility and longevity of their entire lives. A diet full of vitamins and minerals in the right proportions is more than necessary at this time.<br></p>\n<p><strong>Feeding Guideline: </strong>Feeding requirements will vary based on his level of activity, environment and age<br></p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/8_large.JPG?v=1556283861\" alt=\"\"></p>\n<p style=\"margin: 0cm 0cm 12.0pt 0cm;\"><span style=\"font-size: 9pt;\"><strong><span style=\"font-family: Arial, sans-serif; color: #2f2f2f;\">Please Note</span></strong></span><b><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">: </span></b>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet</p>\n<p><strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">Guaranteed Analysis: </span></strong>Crude protein (min.) 33 %, fat content (min.) 20 %, crude ash (max.)7 %, crude fibres (max.)5 %, moisture (max.)12 %, calcium (min.)1.5 %, phosphorus (min.)1.1 %, Omega-6 fatty acids (min.)2.7 %, Omega-3 fatty acids (min.)1 %, DHA (min.)0.3 %, EPA (min.)0.3 %, glucosamine (min.)1400 mg/kg, chondroitin sulfate (min.)900 mg/kg, linoleic acid (min.)2.5 %, carbohydrate (NFE)23.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/8.1_large.JPG?v=1556283866\" alt=\"\"></p>",
