  "id": 2026564517950,
  "title": "Acana Light & Fit Adult Dog Food - All Breeds",
  "handle": "acana-light-fit-dog-food-available-in-multiple-sizes",
  "description": "<p>Acana Light &amp; Fit dog food is a special diet for overweight dogs formulated with limited carbohydrate content to promote the development of lean muscle mass. Naturally rich in all the essential nutrients your pet needs, it does away with the need for adding any supplements.</p>\n<p>This grain-free and gluten-free diet does not contain high glycemic ingredients; instead, it has veggies like whole pumpkin and squash (excellent fibre content). ACANA's Biologically Appropriate* trademark recipes are prepared in their own award-winning kitchens, always using the best and freshest ingredients. These ingredients are deemed fit for human consumption.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>\n<strong>Food Type:</strong> <a href=\"https://headsupfortails.com/collections/dry-dog-food\" title=\"Dry dog food\" target=\"_blank\">Dry dog food</a>\n</li>\n<li>For adult dogs (over 1-year-old)</li>\n<li>Recommended for those dogs who need to lose weight</li>\n<li>Suitable for all breeds</li>\n<li>65% free-run chicken, nest-laid eggs and wild-caught flounder and 35% fruits, vegetables and botanicals</li>\n<li>Grain-free - contains squash and pumpkin</li>\n<li>High-quality ingredients fit for human consumption</li>\n<li>2/3<sup>rd</sup> of the meat is dehydrated <i>without preservatives</i>\n</li>\n<li>1/3<sup>rd</sup> of the meat is fresh <i>without preservatives</i>\n</li>\n<li>WholePrey Ratios rich in nutrients</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food.</li>\n<li>Nutrient Profiles</li>\n<li>Made in Canada</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never exceed recommended feeding quantities unless prescribed by a vet</li>\n</ul>\n<p><strong><span>Ingredients: </span></strong><span>Fresh chicken meat (16%), chicken meal (14%), turkey meal (14%), red lentils, whole green peas, pea fibre, fresh chicken giblets (liver, heart, kidney) (5%), herring meal (5%), fresh whole eggs (4%), fresh whole flounder, (4%), sun-cured alfalfa (4%), field beans (4%), green lentils, whole yellow peas, chicken fat (1%), herring oil, (1%), fresh chicken cartilage (1%), dried brown kelp, fresh whole pumpkin, fresh whole butternut squash, fresh whole parsnips, fresh kale, fresh spinach, fresh mustard greens, fresh turnip greens, fresh whole carrots, fresh red delicious apples, fresh Bartlett pears, freeze-dried chicken liver, freeze-dried turkey liver, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric, milk thistle, burdock root, lavender, marshmallow root, rose hips. </span><span>Supplements </span><span>Zinc Chelate, Vitamin E (preservative).</span></p>\n<p><strong>HUFT Tip:</strong> Loving your dog does not mean feeding them everything they want, a fit dog will live a longer, better life. Follow the feeding guidelines of a vet to get a proper idea of how much and how often your dog needs to eat.<br></p>\n<p><strong>Feeding Guideline: </strong>Every dog is different and may have different feeding needs based on the level of activity, environment and age.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/5_926e2320-bb3b-42ef-9916-b31054012e00_large.JPG?v=1556283441\" alt=\"\" width=\"287\" height=\"148\"></p>\n<p><strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\" data-mce-style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">Please Note: </span></strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\" data-mce-style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet</span></p>",
