  "title": "Acana Adult Dry Dog Food - Small Breed",
  "handle": "acana-adult-small-breed-dog-food-available-in-multiple-sizes",
  "description": "<p>Acana Adult Small Breed dog food is a specially formulated grain-free diet for small breed dogs who are one year and older. This dry food formula contains 60-75% meat protein consisting of free-run chicken, wild-caught flounder and whole, nest-laid eggs. The award-winning kitchens at ACANA use a unique Biologically Appropriate* recipe to create special diets for cats and dogs to suit their evolutionary digestive needs.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>For small breed adults</li>\n<li>60-75% meat protein</li>\n<li>Grain-free - 0% grains, potato, tapioca</li>\n<li>High-quality ingredients fit for human consumption.</li>\n<li>2/3rd of the meat is dehydrated without preservatives</li>\n<li>1/3rd of the meat is fresh without preservatives</li>\n<li>WholePrey Ratios rich in nutrients</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food</li>\n<li>Nutrient Profiles</li>\n<li>Made in Canada</li>\n</ul>\n<p><strong>Ingredients: </strong>Fresh chicken meat (12%), chicken meal (12%), turkey meal (12%), red lentils, whole green peas, field beans, chicken fat (5%), fresh chicken giblets (liver, heart, kidney) (4%), herring meal (4%), fresh whole eggs (4%), fresh whole flounder (4%), herring oil (2%), sun-cured alfalfa (2%), green lentils (2%), whole yellow peas, pea fibre, fresh chicken cartilage (1%), dried brown kelp, fresh whole pumpkin, fresh whole butternut squash, fresh whole parsnips, fresh kale, fresh spinach, fresh mustard greens, fresh turnip greens, fresh whole carrots, fresh red delicious apples, fresh Bartlett pears, freeze-dried chicken liver, freeze-dried turkey liver, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric, milk thistle, burdock root, lavender, marshmallow root, rose hips. Supplements Zinc chelate. Vitamin E (preservative).</p>\n<p><strong>Precautions:</strong></p>\n<ul>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<p><strong>Feeding Guidelines: </strong>Feeding requirements will vary based on your pet's level of activity, environment and age.</p>\n<p><img alt=\"\" src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1_large.JPG?v=1556282723\"></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Please Note: </strong>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet</p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Guaranteed Analysis: </strong>Crude protein (min.) 31 %, Fat content (min.) 17%, Crude ash (max.) 7 %, Crude fibres (max.) 5 %, Moisture(max.) 12%, Calcium (min.) 1.4 %, Phosphorus (min.) 1.1 %, Omega-6 fatty acids (min.) 2.6 %, Omega-3 fatty acids (min.) 1 %, DHA(min.) 0.3 %, EPA(min.) 0.3 %, Glucosamine (min.) 1400 mg/kg, Chondroitin sulfate (min.) 900 mg/kg, Linoleic acid (min.) 2.4 %, Carbohydrate (NFE) 28 %</p>\n<br>\n<p><img height=\"156\" width=\"253\" alt=\"\" src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1.1_large.JPG?v=1556282729\"><br></p>\n<p><strong>HUFT Tip: </strong>Many dogs like pugs and bulldogs tend to wolf down their food very quickly. Often, they bring up their meal soon after, leaving their tummy empty and leading to conditions like acidity. To get these pets to slow down, you should consider investing in slow-feeding bowls.</p>",
