  "title": "Acana Grass-Fed Lamb Dry Dog Food - All Breeds & Ages",
  "handle": "acana-grass-fed-lamb-dog-food-available-in-multiple-sizes",
  "description": "<p>Acana Grass-Fed Lamb is a limited ingredient diet which contains a single protein source i.e. 50% lamb. This makes the food easily digestible and is recommended for dogs with sensitive tummies of all breeds and at any stage of life. The meat, liver and tripe form the natural diet, and fresh apples, squash and pumpkin aid in healthy digestion in this dry food mix.<br></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Food Type: Dry dog food</li>\n<li>Single meat source makes it most suitable for sensitive tummies<br>\n</li>\n<li>Apt for sensitive dogs<br>\n</li>\n<li>Whole Prey Ratios rich in nutrients<br>\n</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Dog Food</li>\n<li>Made in Canada</li>\n<li>50% lamb meat and 50% fruits, vegetables and botanicals</li>\n<li>Grain-free - 0% grains, potato, tapioca</li>\n<li>High-quality human-grade ingredients</li>\n<li>Easily digestible</li>\n<li>For all breeds and life stages</li>\n<li>All-natural, with limited supplements</li>\n</ul>\n<p><strong>Ingredients: </strong>Raw grass-fed lamb (18%), lamb meat meal (18%), whole green peas, whole red lentils, raw lamb liver (4%), lamb fat (4%), fresh red delicious apples (4%), whole garbanzo beans, whole green lentils, whole yellow peas, raw lamb tripe (2%), raw lamb kidney (2%), dried lamb cartilage (2%), lentil fibre, marine algae (1.2%) (pure and sustainable source of DHA and EPA), fresh whole butternut squash, fresh whole pumpkin, dried brown kelp, freeze-dried lamb liver (0.1%), salt, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric root, milk thistle, burdock root, lavender, marshmallow root, rosehips, enterococcus faecium. Supplements: Vitamin D3, Vitamin E, Zinc Chelate, Copper Chelate.</p>\n<p><strong>Precautions:</strong></p>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never exceed recommended feeding quantities unless prescribed by a vet</li>\n<p> </p>\n<p><strong>HUFT Tip: </strong>Obesity in pets has now become a common problem and this can lead to a number of issues including hypertension, breathing difficulties, osteoarthritis and so on. Simple steps like regulating their food intake (to what they really need only) and giving them the appropriate number of treats per day makes a big difference in maintaining their weight.</p>\n<p><strong>Feeding Guide: </strong>Every dog is different and their feeding requirements vary based on the level of activity, environment and age.</p>\n<p><strong>Please note:</strong> This is just a proposed guide; we suggest you check with a vet for specific changes in quantity to suit your pet</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/4_19e5906d-d90f-4edd-b120-613dd1359321_large.JPG?v=1556283307\" alt=\"\"></p>",
