  "title": "Acana Sport & Agility Dog Food - All Breeds - 11.4 kg",
  "handle": "acana-sport-agility-dog-food-available-in-multiple-sizes",
  "description": "<p>It contains 75% free range chicken, wild-caught flatfish and nested eggs (locally sourced). It is free from plant protein concentrates and 1/3<sup>rd</sup> of the meat in this feed is fresh while the remaining 2/3<sup>rd</sup> is dried. This recipe only has zinc as a supplement, the remaining nutrients are from the fresh, natural ingredients.<br></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>75% meat content</li>\n<li>Wild caught flatfish, nest-laid eggs and free-range chicken</li>\n<li>One-third of the meat is raw</li>\n<li>Two third is dried for a concentrated source of protein</li>\n<li>No plant proteins</li>\n<li>Only additional supplement is zinc</li>\n<li>Please check with your vet before altering your pet's diet</li>\n<li>Always have fresh water available for your dog</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<ul></ul>\n<p><strong>Ingredients: </strong>Fresh chicken meat (16%), chicken meal (16%), turkey meal (14%), red lentils, chicken fat (7%), whole green peas (5%), fresh chicken giblets (liver, heart, kidney) (4%), herring meal (4%), herring oil (4%), fresh whole eggs (4%), fresh whole flounder (4%), sun-cured alfalfa, field beans, green lentils, whole yellow peas, fresh chicken cartilage (2%), dried brown kelp, fresh whole pumpkin, fresh whole butternut squash, fresh whole parsnips, fresh kale, fresh spinach, fresh mustard greens, fresh turnip greens, fresh whole carrots, fresh red delicious apples, fresh Bartlett pears, freeze-dried chicken liver, freeze-dried turkey liver, fresh whole cranberries, fresh whole blueberries, chicory root, turmeric, milk thistle, burdock root, lavender, marshmallow root, rose hips. Supplements Zinc chelate. Vitamin E (preservative).</p>\n<p>Contains mixed tocopherols (a tocopherol rich extract of natural origin- Vitamin E and Rosemary Oil). Also contains the probiotic Enterococcus faecium.</p>\n<p><strong><span>HUFT Tip: </span></strong><span>If your dog is active and requires plenty of energy every day, he or she requires a special diet that provides them plenty of nutrition. Speak to a pet nutritionist to understand if the diet you are giving your dog is adequately meeting his or her nutritional requirements.</span></p>\n<ul></ul>\n<p><img alt=\"\" src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/11_large.jpg?v=1556284465\" data-mce-src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/11_large.jpg?v=1556284465\"></p>\n<p><strong>Guaranteed Analysis:</strong></p>\n<p><img alt=\"\" src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/11.1_large.JPG?v=1556284471\" data-mce-src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/11.1_large.JPG?v=1556284471\"></p>",
