  "id": 6771307872318,
  "title": "Acana Pacifica Fish Adult Dry Cat Food",
  "handle": "acana-pacifica-fish-adult-dry-cat-food",
  "description": "<p><span>By nature, all cats and kittens are carnivores, biologically adapted for a diet rich and varied in fresh meats with small amounts of fruits, vegetables and grasses. That why we loaded ACANA Pacifica with 100% wild-caught fish, including herring, flounder and pacific hake that are caught off North Vancouver Island, packed on ice, and whisked to our kitchens fresh and cold as the waters they came from. Grain-and-potato-free to reduce unwanted carbohydrates, ACANA instead features fruits and vegetables delivered fresh and whole from our sun-drenched orchards and black prairie soils. Prepared from Canada best ingredients in our award-winning kitchens, ACANA Pacifica keeps your cat or kitten healthy and strong.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Food Type: Dry cat food</li>\n<li>Suitable for all breeds at all life stages</li>\n<li>100% fish protein</li>\n<li>Regionally sourced, wild-caught fish - Pacific herring, pilchard, flounder, hake and rockfish</li>\n<li>Nutrient-dense, WholePrey Ratios</li>\n<li>Formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles</li>\n<li>Made in Canada</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never exceed recommended feeding quantities unless prescribed by a vet</li>\n</ul>\n<p><strong>HUFT Tip:</strong> Most often, cats form their opinions on food during the first year. So try and get your pet used to different kinds of food early on, this will help you to have a less fussy feline later.</p>\n<p><strong>Feeding Guideline: </strong>Every cat is unique and feeding requirements can vary depending on their age, activity levels and environment.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/6_979ccbec-2449-471a-82ea-aec3d1353587_large.JPG?v=1556283595\" alt=\"\"></p>\n<p><strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">Please Note: </span></strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">This table is just an initial guide and should be adjusted in consultation with a vet to suit your pet</span></p>\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><strong><span style=\"font-size: 9.0pt; font-family: 'Arial',sans-serif; color: #2f2f2f;\">Ingredients: </span></strong><span data-mce-fragment=\"1\">Boneless herring*, herring meal, pollock meal, boneless flounder*, boneless Pacific hake*, chickpeas, red lentils, canola oil, green peas, green lentils, yellow peas, herring oil, sun-cured alfalfa, dried kelp, pumpkin*, butternut squash*, spinach greens*, carrots*, apples*, pears*, cranberries, mixed tocopherols (preservative), chicory root, dandelion root, chamomile, peppermint leaf, ginger root, caraway seeds, turmeric, rose hips, freeze-dried herring, freeze-dried hake, freeze- dried flounder, Enterococcus faecium fermentation product plus premium vitamins and minerals * DELIVERED FRESH FROM OUR REGION DAILY SUPPLEMENTS Zinc Proteinate, copper proteinate, vitamin A supplement, vitamin D3 supplement, dried enterococcus faecium fermentation product.</span></p>\n<h3>Guaranteed Analysis</h3>\n<table>\n<tbody>\n<tr>\n<th>Crude protein (min.) 37 %</th>\n<th>Crude fat (min.) 20 %</th>\n</tr>\n<tr>\n<td>Crude ash (max.) 7.5 %</td>\n<td>Crude fibers (max.) 3 %</td>\n</tr>\n<tr>\n<td>Moisture (max.) 10 %</td>\n<td>Calcium (min.) 1.5 %</td>\n</tr>\n<tr>\n<td>Phosphorus (min.) 1.1 %</td>\n<td>Taurine (min.) 0.15 %</td>\n</tr>\n<tr>\n<td>Omega-6 fatty acids (min.) 2 %</td>\n<td>Omega-3 fatty acids (min.) 2.2 %</td>\n</tr>\n<tr>\n<td>DHA (min.) 1 %</td>\n<td>EPA (min.) 0.8 %</td>\n</tr>\n</tbody>\n</table>",
